import { Pipe, PipeTransform } from '@angular/core';

import type { JSONSchema } from "../types";

type ValueType = Record<string, string[] | readonly string[] | JSONSchema>;
type OutputType = Record<string, string[] | readonly string[]>;

@Pipe({ 
    name: 'dependanciesTodependentRequired',
    standalone: true 
})
export class DependanciesToDependentRequiredPipe implements PipeTransform {
    transform(dependentRequired: ValueType) : OutputType {
        const result: Record<string, string[] | readonly string[]> = {};

        for (const [property, subSchema] of Object.entries(dependentRequired)) {
            if (Array.isArray(subSchema)) {
                // dependentRequired case
                result[property] = subSchema;
            }
        }

        return result;
    }
}

import { Pipe, PipeTransform } from '@angular/core';

import type { JSONSchema } from "../types";

type ValueType = Record<string, string[] | readonly string[] | JSONSchema>;
type OutputType = Record<string, JSONSchema>;

@Pipe({ 
    name: 'dependanciesTodependentSchemas',
    standalone: true 
})
export class DependanciesToDependentSchemasPipe implements PipeTransform {
    transform(dependentSchemas: ValueType) : OutputType {
        const result: Record<string, JSONSchema> = {};

        for (const [property, subSchema] of Object.entries(dependentSchemas)) {
            if (!Array.isArray(subSchema)) {
                // dependentSchemas case
                result[property] = subSchema as JSONSchema;
            }
        }
        
        return result;
    }
}

import { Pipe, PipeTransform } from '@angular/core';

import type { JSONSchema } from "../types";

type ValueType = Record<string, string[] | readonly string[]>;
type OutputType = Exclude<JSONSchema, true | false>;

@Pipe({ 
    name: 'dependentRequired',
    standalone: true 
})
export class DependentRequiredPipe implements PipeTransform {
    transform(dependentRequired: ValueType) : OutputType {
        return {
            allOf: Object.entries(dependentRequired).map(
                ([property, requiredProperties]) => ({
                    if: {
                      type: "object",
                      required: [property],
                    },
                    then: {
                      type: "object",
                      required: requiredProperties,
                    },
                })
            )
        }
    }
}

