import { CommonModule } from '@angular/common';
import { ChangeDetectionStrategy, Component, Input, forwardRef } from '@angular/core';

import {
  CreateEdgeComponent
} from "../../common/index";

import type { JSONSchemaNS, JSONSchema } from "../../types";

@Component({
  selector: 'jse-array-items',
  standalone: true,
  imports: [
    CommonModule,
    forwardRef(() => CreateEdgeComponent)
  ],
  changeDetection: ChangeDetectionStrategy.OnPush,
  template: `
    <ul>
      <ng-container *ngFor="let item of itemsAsArray; let idx = index">
        <jse-common-create-edge [schema]="item" [required]="isMinItemsValid()">
          <code name>
            {{ itemsLabel(startingIndex + idx, isArray) }}
          </code>
        </jse-common-create-edge>
      </ng-container>
    </ul>
  `,
})
export class CreateItemsComponent {
  @Input({ required: true }) schema!: JSONSchemaNS.Array;

  get itemsAsArray(): JSONSchema[] {
    if (this.schema.items === undefined) {
      return [];
    }
    return Array.isArray(this.schema.items) ? this.schema.items : [this.schema.items];
  }

  get startingIndex(): number {
    return Array.isArray(this.schema.prefixItems) ? this.schema.prefixItems.length : 0;
  }

  get isArray(): boolean {
    return Array.isArray(this.schema.items);
  }

  isMinItemsValid(): boolean {
    return this.schema.minItems !== undefined && this.schema.minItems >= this.itemsAsArray.length;
  }

  itemsLabel(index: number, isArray: boolean): string {
    const finalIdx = isArray ? index.toString() : 'x';
    return `items[${finalIdx}]`;
  }
}

import { CommonModule } from '@angular/common';
import { ChangeDetectionStrategy, Component, Input, forwardRef } from '@angular/core';

import {
    SchemaConditionalComponent,
    SchemaCompositionComponent,
} from "../JSONSchemaElements/index";

import {
  isSchemaComposition,
  isSchemaConditional,
} from '../utils/index';

import {
    CreateTypesComponent,
    CreateValidOrInvalidComponent
} from "./index";

import type { JSONSchema } from '../types';


@Component({
  selector: 'jse-common-create-nodes',
  standalone: true,
  imports: [
    CommonModule,
    forwardRef(() => SchemaConditionalComponent),
    forwardRef(() => SchemaCompositionComponent),
    forwardRef(() => CreateTypesComponent),
    forwardRef(() => CreateValidOrInvalidComponent)
  ],
  changeDetection: ChangeDetectionStrategy.OnPush,
  template: `
    <ng-container *ngIf="typedSchema !== undefined; else BooleanSchema">

      <!-- Handle standard types -->
      <jse-common-create-types [schema]="typedSchema" />

      <!-- Handle Composition -->
      <ng-container *ngIf="isCompositionSchema">
        <jse-schema-composition [schema]="typedSchema" />
      </ng-container>

      <!-- Handle Conditional -->
      <ng-container *ngIf="isConditionalSchema">
        <jse-schema-conditional [schema]="typedSchema" />
      </ng-container>
      
    </ng-container>

    <ng-template #BooleanSchema>
      <jse-common-create-valid-or-invalid [schema]="schema" />
    </ng-template>
  `,
})
export class CreateNodesComponent {
  @Input({ required: true }) schema!: JSONSchema;

  // Check if the schema is a composition
  get isCompositionSchema() : boolean {
    return isSchemaComposition(this.schema);
  };

  // Check if the schema is conditional
  get isConditionalSchema() : boolean {
    return isSchemaConditional(this.schema);
  };
  // Typed schema, if not a boolean
  get typedSchema(): Exclude<JSONSchema, false | true> | undefined {
    let isBooleanSchema = typeof this.schema === 'boolean';
    if (!isBooleanSchema) {
      return this.schema as Exclude<JSONSchema, false | true>;
    } else {
      return undefined;
    }
  };

}

